import React from 'react';
import { Card, Typography, List, ListItem, ListItemIcon, ListItemText, Divider, Box, Chip } from '@mui/material';
import {
  MedicalServices,
  Warning,
  CheckCircle,
  Info,
  LocalHospital,
  MonitorHeart,
  Psychology,
  FitnessCenter,
  Restaurant,
  Spa
} from '@mui/icons-material';

const MedicalHistoryAnalysis = ({ analysis }) => {
  if (!analysis) return null;

  const sections = [
    {
      title: 'Medical History Summary',
      icon: <MedicalServices />,
      content: analysis.history_analysis?.summary || 'No medical history provided'
    },
    {
      title: 'Risk Factors',
      icon: <Warning />,
      content: analysis.history_analysis?.risk_factors || 'Standard risk factors apply'
    },
    {
      title: 'Potential Complications',
      icon: <LocalHospital />,
      content: analysis.history_analysis?.complications || 'Standard complication monitoring'
    },
    {
      title: 'Recommended Tests',
      icon: <MonitorHeart />,
      content: analysis.history_analysis?.recommended_tests || 'Standard screening tests'
    },
    {
      title: 'Precautions',
      icon: <CheckCircle />,
      content: analysis.history_analysis?.precautions || 'Standard precautions'
    },
    {
      title: 'Monitoring Plan',
      icon: <Info />,
      content: analysis.history_analysis?.monitoring || 'Standard monitoring parameters'
    }
  ];

  const lifestyleSections = [
    {
      title: 'Diet Recommendations',
      icon: <Restaurant />,
      content: analysis.recommendations?.diet || 'Balanced diet recommendations'
    },
    {
      title: 'Exercise Guidelines',
      icon: <FitnessCenter />,
      content: analysis.recommendations?.exercise || 'Regular exercise recommendations'
    },
    {
      title: 'Stress Management',
      icon: <Spa />,
      content: analysis.recommendations?.stress || 'Stress management techniques'
    }
  ];

  return (
    <Box sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom sx={{ color: '#2c3e50', fontWeight: 'bold' }}>
        Medical History Analysis
      </Typography>

      <Card sx={{ p: 3, mb: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
        <Typography variant="h6" gutterBottom sx={{ color: '#34495e', display: 'flex', alignItems: 'center', gap: 1 }}>
          <MedicalServices sx={{ color: '#3498db' }} />
          Medical History Overview
        </Typography>
        <Typography variant="body1" sx={{ color: '#2c3e50', mt: 2 }}>
          {analysis.history_analysis?.summary || 'No medical history provided'}
        </Typography>
      </Card>

      <Box sx={{ display: 'grid', gridTemplateColumns: { xs: '1fr', md: '1fr 1fr' }, gap: 3 }}>
        <Card sx={{ p: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
          <Typography variant="h6" gutterBottom sx={{ color: '#34495e', mb: 2 }}>
            Clinical Assessment
          </Typography>
          <List>
            {sections.map((section, index) => (
              <React.Fragment key={index}>
                <ListItem>
                  <ListItemIcon sx={{ color: '#3498db' }}>
                    {section.icon}
                  </ListItemIcon>
                  <ListItemText
                    primary={
                      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', color: '#2c3e50' }}>
                        {section.title}
                      </Typography>
                    }
                    secondary={
                      <Typography variant="body2" sx={{ color: '#34495e', mt: 1 }}>
                        {section.content}
                      </Typography>
                    }
                  />
                </ListItem>
                {index < sections.length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </Card>

        <Card sx={{ p: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
          <Typography variant="h6" gutterBottom sx={{ color: '#34495e', mb: 2 }}>
            Lifestyle Recommendations
          </Typography>
          <List>
            {lifestyleSections.map((section, index) => (
              <React.Fragment key={index}>
                <ListItem>
                  <ListItemIcon sx={{ color: '#2ecc71' }}>
                    {section.icon}
                  </ListItemIcon>
                  <ListItemText
                    primary={
                      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', color: '#2c3e50' }}>
                        {section.title}
                      </Typography>
                    }
                    secondary={
                      <Typography variant="body2" sx={{ color: '#34495e', mt: 1 }}>
                        {section.content}
                      </Typography>
                    }
                  />
                </ListItem>
                {index < lifestyleSections.length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </Card>
      </Box>

      <Card sx={{ p: 3, mt: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
        <Typography variant="h6" gutterBottom sx={{ color: '#34495e', display: 'flex', alignItems: 'center', gap: 1 }}>
          <Psychology sx={{ color: '#e74c3c' }} />
          Important Notes
        </Typography>
        <List>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • This is an AI-generated preliminary analysis and should not replace professional medical evaluation
                </Typography>
              }
            />
          </ListItem>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • Seek immediate medical attention if symptoms worsen or new symptoms develop
                </Typography>
              }
            />
          </ListItem>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • Regular follow-up with healthcare providers is essential
                </Typography>
              }
            />
          </ListItem>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • Maintain a symptom diary for better tracking
                </Typography>
              }
            />
          </ListItem>
        </List>
      </Card>
    </Box>
  );
};

export default MedicalHistoryAnalysis;
